import React, { Component, useState } from "react";
class button extends Component
{
    constructor(){
        super();
      this.state= { number:0}
    }
    clickEvent()
       {this.setState(previousNumber=>this.state.number=previousState+1);}
       render(){return <button type="button" class="btn btn-info" onClick={clickEvent}>Info</button>;}
    
}
export default button;
